import React from 'react'

const Navbar = () => {
    const path = window.location.pathname
    return (
        <nav className='nav'>
        <a href='/' className='site-title'>Site Name</a>
        <ul>
            <li className='active'>
                <a href='/pricing'>Pricing</a>
            </li>
            <li>
            <a href='/about'>About</a>
            </li>
        </ul>
        </nav>
    )
}

function CustomLink({href, ...props}){
